    render(){
        
    
 // packs = Pack.find({});

// Sample data
const data = [
  { argument:'Monday', value:10, text: "South" },
  { argument:'Tuesday', value:40, text: "North" },
  { argument:'Wednesday', value:10, text: "Jerusalem and nearby"},
  { argument:'Thursday', value:20, text: "TLV and nearby" },
  { argument:'Friday', value:20, text: "Yehuda VeShomron" },
];
return (
    <Paper>
    <Chart
      data={data}
    >
      <PieSeries valueField="value" argumentField="argument" TextField="text" innerRadius={0.6}>
          <label>text</label>
          <text>text</text>
          </PieSeries>
      <Title text="Distributions this last month"/>
    </Chart>
  </Paper>
);
}
